import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Home from './pages/Home'
import Navbar from './Components/Navigation';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div className="pages">
        <Navbar />
        <Routes>
          <Route
          path="/"
          element={<Home />}
          />
        </Routes>
      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
